import SidebarRow from './SidebarRow';
import {    SearchIcon,
    UsersIcon, 
    RssIcon,
    VideoCameraIcon, 
    MusicNoteIcon, 
    BookOpenIcon, 
    ShoppingBagIcon } from '@heroicons/react/outline'

function Sidebar(){
return (
    <div className="p-2 m-3 hidden sm:inline-flex w-1/4 m-x-4 bg-gray-300 z-40 fixed rounded-xl">

    <SidebarRow Icon = {UsersIcon} title ="Socializing"/>
    <SidebarRow Icon = {RssIcon} title="Blogging"/>
    <SidebarRow Icon = {VideoCameraIcon}title="Watching"/> 
    <SidebarRow Icon = {MusicNoteIcon}title="Listening"/>
    <SidebarRow Icon = {BookOpenIcon} title="Reading"/> 
    <SidebarRow Icon = {ShoppingBagIcon} title="Shopping"/> 

</div>
);
}
export default Sidebar;
